import React from "react";
import s from './My_post.module.css';

function My_post(props) {
    return (
        <div className={s.post}>
            <img src="https://qph.fs.quoracdn.net/main-qimg-c1f256f3116c78e542fa40ba999ba849.webp" alt="kaneki"/>
            {props.message}
            <div>
                {props.dislike_count}
                <img
                    src="data:image/png;base64,"
                    alt=""/>
                {props.like_count}
                <img
                    src="data:image/png;base64,"
                    alt=""/>
            </div>
        </div>)
}

export default My_post;
